package parser_test

import (
	"testing"

	"github.com/envkey/envkey-fetch/parser"

	"github.com/stretchr/testify/assert"
)

var response = parser.EnvServiceResponse{
	env,
	encryptedPrivkey,
	pubkey,
	signedTrustedPubkeys,
	signedById,
	signedByPubkey,
	signedByTrustedPubkeys,
	"",
	"",
	"",
	"",
	true,
}

var responseWithInheritance = parser.EnvServiceResponse{
	env,
	encryptedPrivkey,
	pubkey,
	signedTrustedPubkeys,
	signedById,
	signedByPubkey,
	signedByTrustedPubkeys,
	inheritanceOverrides,
	inheritanceOverridesSignedById,
	inheritanceOverridesSignedByPubkey,
	inheritanceOverridesSignedByTrustedPubkeys,
	true,
}

func TestParse(t *testing.T) {
	envJson, err := response.Parse(passphrase)

	assert.Nil(t, err, "Should not return an error.")
	assert.Equal(t, envJson, `{"GO_TEST":"it","GO_TEST_2":"works!"}`)

	inheritanceEnvJson, err := responseWithInheritance.Parse(passphrase)

	assert.Nil(t, err, "Should not return an error.")
	assert.Equal(t, inheritanceEnvJson, `{"GO_TEST":"it-inherits","GO_TEST_2":"works!-inherits"}`)

}

